$factory->define(App\User::class, function (Faker\Generator $faker) {
    return [
        'name' => $faker->name,
        'email' => $faker->safeEmail,
        'password' => bcrypt(str_random(10)),
        'remember_token' => str_random(10),
    ];
});

$factory->define(App\Event::class, function (Faker\Generator $faker) {
    return [
        'name' => 'Festival FFIEL 2016',
        'startDate' =>$faker->dateTimeInInterval($startDate = '+5 days', $interval = '+ 15 days', $timezone = date_default_timezone_get()),
        'endDate' =>$faker->dateTimeInInterval($startDate = '+10 days', $interval = '+ 25 days', $timezone = date_default_timezone_get()),
        'description'=> $faker->sentence($nbWords = 1000, $variableNbWords = true),
        'image' => '',
    ];
});


